import React, { Component } from 'react'
import { connect } from 'react-redux'
import { } from '../../Redux/action'
import uuidv4 from 'uuid'
import Navbar from '../Common/Navbar'
import { Redirect } from 'react-router-dom'

class ViewTicket extends Component {
    constructor(props) {
        super(props)

    }

    render() {
        const { allUserTicket, match, companyData } = this.props
        // console.log(allUserTicket,match)
        const data = allUserTicket.find(item => item.id === Number(match.params.id))

        return (
            <>
                <Navbar />
                <div className="container" style={{ marginTop: "150px" }}>
                    <div className="row">
                        <div className="offset-3 col-6">
                            <div class="card border-info mb-3">
                                <div class="card-header">Ticket Information</div>
                                <div class="card-body text-info">
                                    <h5 class="card-title">{data.title}</h5>
                                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </>
        )
    }
}

